import React from "react";


const Footer = () => {
    return (
        <footer>
			<div className="social-icons">
				<a href="https://www.linkedin.com/in/irene-novelo-6205396a/" target="_blank"><i
						className="fab fa-linkedin"></i></a>
				<a href="https://www.twitter.com/pandy8824" target="_blank"><i class="fab fa-twitter"></i></a>
				<a href="https://instagram.com/introducing_pickle" target="_blank"><i class="fab fa-instagram"></i></a>
			</div>
		</footer>
    )
}

export default Footer
